def get_transition_points(filename: str) -> List[float]:
    """Get transition points for a specific audio file."""
    return TRANSITION_POINTS.get(filename, {}).get("transition_points", [])

def get_beat_points(filename: str) -> List[float]:
    """Get beat points for a specific audio file."""
    return TRANSITION_POINTS.get(filename, {}).get("beats", [])

def get_measure_points(filename: str) -> List[float]:
    """Get measure points for a specific audio file."""
    return TRANSITION_POINTS.get(filename, {}).get("measures", [])

def get_tempo(filename: str) -> float:
    """Get tempo for a specific audio file."""
    return TRANSITION_POINTS.get(filename, {}).get("tempo", 120.0)

def get_duration(filename: str) -> float:
    """Get duration for a specific audio file."""
    return TRANSITION_POINTS.get(filename, {}).get("duration", 0.0)

